class SynchronySendsTest(unittest.TestCase):
    curr_time = -1

    def setUp(self):
        self.old_time = time.time

    def tearDown(self):
        time.time = self.old_time # testing infrastructure relies on time.time() so restore it after we're done
        synchrony.start_time = None

    def time():
        # mock time function that just returns a constant
        return SynchronySendsTest.curr_time

    def mock_values(example_value):
        SynchronySendsTest.curr_time = example_value[0]
        synchrony.time.time = SynchronySendsTest.time
        synchrony.start_time = example_value[1]
        synchrony.synchrony_assumption = example_value[2]

    def test_synchrony_rounds(self):
        global example_parameters, expected_outputs
        # make sure start_time is initially none so function returns none
        self.assertIsNone(synchrony.should_send())
        for test_index in range(len(example_parameters)):
            test_value = example_parameters[test_index]
            SynchronySendsTest.mock_values(test_value)
            self.assertEqual(synchrony.should_send(), expected_outputs[test_index])

if __name__ == '__main__':
    unittest.main()


